/*Table structure for table `fan_homepage` */

DROP TABLE IF EXISTS `fan_homepage`;

CREATE TABLE `fan_homepage` (
  `fid` int(11) NOT NULL COMMENT '粉丝编号',
  `fname` varchar(100) DEFAULT NULL COMMENT '粉丝名字（博主主页信息）',
  `fintro` varchar(400) DEFAULT NULL COMMENT '粉丝简介',
  `ffollowing` int(11) DEFAULT NULL COMMENT '粉丝关注数',
  `ffollower` int(11) DEFAULT NULL COMMENT '粉丝粉丝数',
  `fblog` int(11) DEFAULT NULL COMMENT '粉丝微博数',
  `fimg` varchar(100) DEFAULT NULL COMMENT '粉丝头像地址链接',
  `frank` int(11) DEFAULT NULL COMMENT '粉丝等级',
  `fgrade` int(11) DEFAULT NULL COMMENT '粉丝总排名',
  PRIMARY KEY (`fid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_homepage` */

/*Table structure for table `fan_kongping` */

DROP TABLE IF EXISTS `fan_kongping`;

CREATE TABLE `fan_kongping` (
  `fname` varchar(100) DEFAULT NULL COMMENT '控评粉丝名称',
  `tote` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_kongping` */

/*Table structure for table `fan_name_keyword` */

DROP TABLE IF EXISTS `fan_name_keyword`;

CREATE TABLE `fan_name_keyword` (
  `keyword` varchar(20) DEFAULT NULL COMMENT '粉丝名的关键字',
  `totel` int(11) DEFAULT NULL COMMENT '关键字数量'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_name_keyword` */

/*Table structure for table `fan_phone` */

DROP TABLE IF EXISTS `fan_phone`;

CREATE TABLE `fan_phone` (
  `ptype` varchar(40) DEFAULT NULL COMMENT '手机型号',
  `tote` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_phone` */

/*Table structure for table `fan_power` */

DROP TABLE IF EXISTS `fan_power`;

CREATE TABLE `fan_power` (
  `fid` int(11) DEFAULT NULL COMMENT '粉丝id',
  `comment` varchar(600) DEFAULT NULL COMMENT '粉丝评论内容',
  `liketote` int(11) DEFAULT NULL COMMENT '评论内容点赞数',
  `commtote` int(11) DEFAULT NULL COMMENT '评论内容评论数',
  `transtoto` int(11) DEFAULT NULL COMMENT '评论内容转发数',
  KEY `fid` (`fid`),
  CONSTRAINT `fan_power_ibfk_1` FOREIGN KEY (`fid`) REFERENCES `fan_homepage` (`fid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_power` */

/*Table structure for table `fan_region` */

DROP TABLE IF EXISTS `fan_region`;

CREATE TABLE `fan_region` (
  `province` varchar(100) DEFAULT NULL COMMENT '粉丝所在省',
  `tote` int(11) DEFAULT NULL COMMENT '省份中粉丝数量'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_region` */

/*Table structure for table `project_star_topic` */

DROP TABLE IF EXISTS `project_star_topic`;

CREATE TABLE `project_star_topic` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `keyword` varchar(40) NOT NULL,
